import { useRef } from 'react'

function RegisterSource() {
  return (
    <div
      style={{
        flex: 1,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column',
      }}
    >
      <span
        style={{
          color: 'black',
          fontSize: 20,
          fontWeight: 'bold',
          marginBottom: 20,
          marginTop: 20,
        }}
      >
        Đăng kí học phần
      </span>
    </div>
  )
}
export default RegisterSource
